contract Common {
    uint256 constant RAY = 10 ** 27;

    // Internal functions

    function mul(uint x, uint y) internal pure returns (uint z) {
        require(y == 0 || (z = x * y) / y == x, "mul-overflow");
    }

    // Public functions

    function coinJoin_join(address apt, address safe, uint wad) public {
        // Gets StablePro from the user's wallet
        CoinJoinLike(apt).systemCoin().transferFrom(msg.sender, address(this), wad);
        // Approves adapter to take the StablePro amount
        CoinJoinLike(apt).systemCoin().approve(apt, wad);
        // Joins StablePro into the safeEngine
        CoinJoinLike(apt).join(safe, wad);
    }
}

contract DssProxyActions is Common {
    // Internal functions

    function sub(uint x, uint y) internal pure returns (uint z) {
        require((z = x - y) <= x, "sub-overflow");
    }

    function toInt(uint x) internal pure returns (int y) {
        y = int(x);
        require(y >= 0, "int-overflow");
    }

    function toRad(uint wad) internal pure returns (uint rad) {
        rad = mul(wad, 10 ** 27);
    }

    function convertTo18(address collateralJoin, uint256 amt) internal returns (uint256 wad) {
        // For those collaterals that have less than 18 decimals precision we need to do the conversion
        // before passing to modifySAFECollateralization function
        // Adapters will automatically handle the difference of precision
        wad = mul(
            amt,
            10 ** (18 - CollateralJoinLike(collateralJoin).decimals())
        );
    }

    function _getGeneratedDeltaDebt(
        address safeEngine,
        address taxCollector,
        address safe,
        bytes32 collateralType,
        uint wad
    ) internal returns (int deltaDebt) {
        // Updates stability fee rate
        uint rate = taxCollectorLike(taxCollector).taxSingle(collateralType);

        // Gets StablePro balance of the safe in the safeEngine
        uint stableProBalance = SafeEngineLike(safeEngine).coinBalance(safe);

        // If there was already enough StablePro in the safeEngine balance, just exits it without adding more debt
        if (stableProBalance < mul(wad, RAY)) {
            // Calculates the needed deltaDebt so together with the existing StablePro in the safeEngine
            // is enough to exit wad amount of StablePro tokens
            deltaDebt = toInt(sub(mul(wad, RAY), stableProBalance) / rate);
            // This is neeeded due lack of precision. It might need to sum an extra deltaDebt wei
            // (for the given StablePro wad amount)
            deltaDebt = mul(uint(deltaDebt), rate) < mul(wad, RAY) ? deltaDebt + 1 : deltaDebt;
        }
    }

    function _getRepaidDeltaDebt(
        address safeEngine,
        uint stablePro,
        address safe,
        bytes32 collateralType
    ) internal view returns (int deltaDebt) {
        // Gets actual rate from the safeEngine
        (, uint rate,,,) = SafeEngineLike(safeEngine).collateralTypes(collateralType);
        // Gets actual safeDebt value of the safe
        (, uint safeDebt) = SafeEngineLike(safeEngine).safes(collateralType, safe);

        // Uses the whole StablePro balance in the safeEngine to reduce the debt
        deltaDebt = toInt(stablePro / rate);
        // Checks the calculated deltaDebt is not higher than safe.safeDebt (total debt), otherwise uses its value
        deltaDebt = uint(deltaDebt) <= safeDebt ? - deltaDebt : - toInt(safeDebt);
    }

    function _getWipeAllWad(
        address safeEngine,
        address usr,
        address safe,
        bytes32 collateralType
    ) internal view returns (uint wad) {
        // Gets actual rate from the safeEngine
        (, uint rate,,,) = SafeEngineLike(safeEngine).collateralTypes(collateralType);
        // Gets actual safeDebt value of the safe
        (, uint safeDebt) = SafeEngineLike(safeEngine).safes(collateralType, safe);
        // Gets actual StablePro amount in the safe
        uint stablePro = SafeEngineLike(safeEngine).coinBalance(usr);

        uint rad = sub(mul(safeDebt, rate), stablePro);
        wad = rad / RAY;

        // If the rad precision has some dust, it will need to request for 1 extra wad wei
        wad = mul(wad, RAY) < rad ? wad + 1 : wad;
    }

    //TODO: optimize
    function transferCollateral(address manager, uint cdp, address dst, uint wad) internal {
        ManagerLike(manager).transferCollateral(cdp, dst, wad);
    }

    function modifySAFECollateralization(address manager, uint cdp, int deltaCollateral, int deltaDebt) public {
        ManagerLike(manager).modifySAFECollateralization(cdp, deltaCollateral, deltaDebt);
    }

    function openSafe(address manager, bytes32 collateralType, address usr) internal returns (uint cdp) {
        cdp = ManagerLike(manager).openSafe(collateralType, usr);
    }

    function transferInternalCoins(address manager, uint cdp, address dst, uint rad) internal {
        ManagerLike(manager).transferInternalCoins(cdp, dst, rad);
    }

    // Public functions

    function collateralJoin_join(address apt, address safe, uint amt, bool transferFrom) public {
        // Only executes for tokens that have approval/transferFrom implementation
        if (transferFrom) {
            // Gets token from the user's wallet
            CollateralJoinLike(apt).collateral().transferFrom(msg.sender, address(this), amt);
            // Approves adapter to take the token amount
            CollateralJoinLike(apt).collateral().approve(apt, amt);
        }
        // Joins token collateral into the safeEngine
        CollateralJoinLike(apt).join(safe, amt);
    }

    function lockTokenCollateral(
        address manager,
        address collateralJoin,
        uint cdp,
        uint amt,
        bool transferFrom
    ) public {
        // Takes token amount from user's wallet and joins into the safeEngine
        collateralJoin_join(collateralJoin, address(this), amt, transferFrom);
        // Locks token amount into the CDP
        SafeEngineLike(ManagerLike(manager).safeEngine()).modifySAFECollateralization(
            ManagerLike(manager).collateralTypes(cdp),
            ManagerLike(manager).safes(cdp),
            address(this),
            address(this),
            toInt(convertTo18(collateralJoin, amt)),
            0
        );
    }

//    function safeLockTokenCollateral(
//        address manager,
//        address collateralJoin,
//        uint cdp,
//        uint amt,
//        bool transferFrom,
//        address owner
//    ) public {
//        require(ManagerLike(manager).owns(cdp) == owner, "bad-owner");
//        lockTokenCollateral(manager, collateralJoin, cdp, amt, transferFrom);
//    }

    function freeTokenCollateral(
        address manager,
        address collateralJoin,
        uint cdp,
        uint amt
    ) public {
        uint wad = convertTo18(collateralJoin, amt);
        // Unlocks token amount from the CDP
        modifySAFECollateralization(manager, cdp, -toInt(wad), 0);
        // Moves the amount from the CDP safe to proxy's address
        transferCollateral(manager, cdp, address(this), wad);
        // Exits token amount to the user's wallet as a token
        CollateralJoinLike(collateralJoin).exit(msg.sender, amt);
    }

    function exitTokenCollateral(
        address manager,
        address collateralJoin,
        uint cdp,
        uint amt
    ) public {
        // Moves the amount from the CDP safe to proxy's address
        transferCollateral(manager, cdp, address(this), convertTo18(collateralJoin, amt));

        // Exits token amount to the user's wallet as a token
        CollateralJoinLike(collateralJoin).exit(msg.sender, amt);
    }

    function generateDebt(
        address manager,
        address taxCollector,
        address coinJoin,
        uint cdp,
        uint wad
    ) public {
        address safe = ManagerLike(manager).safes(cdp);
        address safeEngine = ManagerLike(manager).safeEngine();
        bytes32 collateralType = ManagerLike(manager).collateralTypes(cdp);
        // Generates debt in the CDP
        modifySAFECollateralization(
            manager,
            cdp,
            0,
            _getGeneratedDeltaDebt(safeEngine, taxCollector, safe, collateralType, wad)
        );
        // Moves the StablePro amount (balance in the safeEngine in rad) to proxy's address
        transferInternalCoins(manager, cdp, address(this), toRad(wad));
        // Allows adapter to access to proxy's StablePro balance in the safeEngine
        if (SafeEngineLike(safeEngine).cdpRights(address(this), address(coinJoin)) == 0) {
            SafeEngineLike(safeEngine).approveSAFEModification(coinJoin);
        }
        // Exits StablePro to the user's wallet as a token
        CoinJoinLike(coinJoin).exit(msg.sender, wad);
    }

    function repayDebt(
        address manager,
        address coinJoin,
        uint cdp,
        uint wad
    ) public {
        address safeEngine = ManagerLike(manager).safeEngine();
        address safe = ManagerLike(manager).safes(cdp);
        bytes32 collateralType = ManagerLike(manager).collateralTypes(cdp);

        address own = ManagerLike(manager).owns(cdp);
        if (own == address(this) || ManagerLike(manager).cdpCan(own, cdp, address(this)) == 1) {
            // Joins StablePro amount into the safeEngine
            coinJoin_join(coinJoin, safe, wad);
            // Paybacks debt to the CDP
            modifySAFECollateralization(
                manager,
                cdp,
                0,
                _getRepaidDeltaDebt(safeEngine, SafeEngineLike(safeEngine).coinBalance(safe), safe, collateralType)
            );
        } else {
            // Joins StablePro amount into the safeEngine
            coinJoin_join(coinJoin, address(this), wad);
            // Paybacks debt to the CDP
            SafeEngineLike(safeEngine).modifySAFECollateralization(
                collateralType,
                safe,
                address(this),
                address(this),
                0,
                _getRepaidDeltaDebt(safeEngine, wad * RAY, safe, collateralType)
            );
        }
    }

//    function safeRepayDebt(
//        address manager,
//        address coinJoin,
//        uint cdp,
//        uint wad,
//        address owner
//    ) public {
//        require(ManagerLike(manager).owns(cdp) == owner, "bad-owner");
//        repayDebt(manager, coinJoin, cdp, wad);
