        address safeEngine = ManagerLike(manager).safeEngine();

        (uint256 lockedCollateral, uint256 generatedDebt) = getCdpInfo(manager, user, collateralType);
        (, uint rate, uint safetyPrice,,) = SafeEngineLike(safeEngine).collateralTypes(collateralType);

        uint256 usdLimit = mul(lockedCollateral, safetyPrice) / rate;
        return usdLimit > generatedDebt ? sub(usdLimit, generatedDebt) : 0;
    }
